import React, { Component } from 'react';
import './App.css'
import VenueListings from './VenueListing'
import Header from './Header'


class App extends Component {
  state = {
    venues: [],
    buttonInput: ''
  }

  componentDidMount() {
    let url = `https://api.foursquare.com/v2/venues/search?client_id=ST23AEQHHZXZSAVCBLBO4KZQZVA0KXNULNFPAVHFKMJLZ0OY&client_secret=NN3W2M14CHEJ2BCF21ORXCWWA5VYMXAWQYXTWG5414LU2RX0&v=20180323&ll=40.7,-74&query=bar`
    fetch(url)
    .then(res => res.json())
    .then(data => {
      this.setState({
        venues: data.response.venues,
        value: ''
      })
      console.log(this.state.venues)
    })
  }

  render() {
    return (
      <div className="App">
      <Header />
      <VenueListings venues={this.state.venues} />
      </div>
    );
  }
}

export default App;

